function initSnapshotTips(){$("a.snapshotTip").each(function(){var a=$(this).attr("href");var c="<div>"+GITPHP_RES_SNAPSHOT+": ";var d=true;for(var b in GITPHP_SNAPSHOT_FORMATS){if(!d){c+=" | "}c+='<a href="'+a+"&fmt="+b+'">'+GITPHP_SNAPSHOT_FORMATS[b]+"</a>";d=false}c+="</div>";$(this).qtip({content:{text:c},show:{event:"click"},hide:{fixed:true,delay:150},style:{classes:"ui-tooltip-light ui-tooltip-shadow"},position:{adjust:{screen:true}}});$(this).click(function(){return false})})}function initCommitTips(){var b=window.location.href.match(/p=([^&]+)/);if(!b){return}b=unescape(b[1]);var a=window.location.href.match(/^([^\?]+\/)/);if(!a){return}a=a[1];$("a.commitTip").each(function(){var c=$(this).attr("href").match(/h=([0-9a-fA-F]{40}|HEAD)/);if(!c){return}c=c[1];$(this).qtip({content:{text:'<img src="'+a+'images/tooltip-loader.gif" alt="'+GITPHP_RES_LOADING+'" />',ajax:{url:"index.php",data:{p:b,a:"commit",o:"jstip",h:c},type:"GET"}},style:{classes:"ui-tooltip-light ui-tooltip-shadow"},position:{adjust:{screen:true}}})})}function initTagTips(){var b=window.location.href.match(/p=([^&]+)/);if(!b){return}b=unescape(b[1]);var a=window.location.href.match(/^([^\?]+\/)/);if(!a){return}a=a[1];$("a.tagTip").each(function(){var c=$(this).attr("href").match(/h=([^&]+)/);if(!c){return}c=c[1];$(this).qtip({content:{text:'<img src="'+a+'images/tooltip-loader.gif" alt="'+GITPHP_RES_LOADING+'" />',ajax:{url:"index.php",data:{p:b,a:"tag",o:"jstip",h:c},type:"GET"}},style:{classes:"ui-tooltip-light ui-tooltip-shadow"},position:{adjust:{screen:true}}})})}$(document).ready(function(){initCommitTips();initTagTips();initSnapshotTips()});